import logo from './logo.svg';
import './App.css';
import Greeting from './Greeting';
import {Add, Sub, Div, Mul} from './Calc';
import Card from './Card';
import Sdata from './Sdata';

function App() {
  return (
    <>
    <div className="App">
      <Greeting />
    </div>
    <div>
     <ul>
       <li>{Add(4,5)}</li>
       <li>{Sub(4,5)}</li>
       <li>{Mul(4,5)}</li>
       <li>{Div(4,5)}</li>
     </ul>
    </div>
      <div>
      {Sdata.map((val,index)=>{
       return(
         <Card 
         key={val.id}
         imgSrc={val.imgSrc}
         title={val.title}
         />

       )


     })}
      </div>



    </>
  );
}

export default App;
